import React from 'react';
import ReactDOM from 'react-dom/client';

import App from './App';


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

const IMAGES = {
  python: require('.images//python.svg'),
  R: require('./R.svg')
}

export default IMAGES;
